import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
    const [serverStatus, setServerStatus] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        checkServerHealth();
    }, []);

    const checkServerHealth = async () => {
        try {
            const response = await axios.get('/health');
            setServerStatus(response.data);
        } catch (error) {
            console.error('Failed to connect to server:', error);
            setServerStatus({ status: 'ERROR', message: 'Server not reachable' });
        } finally {
            setLoading(false);
        }
    };

    const testUpload = async () => {
        const formData = new FormData();
        const testFile = new Blob(['Test PDF content'], { type: 'application/pdf' });
        formData.append('pdf', testFile, 'test.pdf');

        try {
            const response = await axios.post('/upload', formData, {
                headers: { 'Content-Type': 'multipart/form-data' }
            });
            alert('Upload test successful: ' + response.data.message);
        } catch (error) {
            alert('Upload test failed: ' + error.response?.data?.error || error.message);
        }
    };

    const testQuery = async () => {
        try {
            const response = await axios.post('/query', { question: 'Test question' });
            alert('Query test successful: ' + (response.data.message || 'No message returned'));
        } catch (error) {
            alert('Query test failed: ' + (error.response?.data?.error || error.message));
        }
    };


    if (loading) {
        return (
            <div className="App">
                <header className="App-header">
                    <h1>PDF RAG Application</h1>
                    <p>Loading...</p>
                </header>
            </div>
        );
    }

    return (
        <div className="App">
            <header className="App-header">
                <h1>PDF RAG Application - Phase 1</h1>
                <p>Project Setup and Environment Configuration</p>

                <div className="status-section">
                    <h2>System Status</h2>
                    <div className={`status-indicator ${serverStatus?.status === 'OK' ? 'success' : 'error'}`}>
                        <strong>Backend Server:</strong> {serverStatus?.status || 'Unknown'}
                    </div>
                    <div className={`status-indicator ${serverStatus?.neo4j === 'Connected' ? 'success' : 'error'}`}>
                        <strong>Neo4j Database:</strong> {serverStatus?.neo4j || 'Unknown'}
                    </div>
                    <p><strong>Last Updated:</strong> {serverStatus?.timestamp || 'Unknown'}</p>
                </div>

                <div className="test-section">
                    <h2>Phase 1 Tests</h2>
                    <p>Test basic connectivity and placeholder endpoints:</p>
                    <button onClick={testUpload} className="test-button">
                        Test Upload Endpoint
                    </button>
                    <button onClick={testQuery} className="test-button">
                        Test Query Endpoint
                    </button>
                    <button onClick={checkServerHealth} className="test-button">
                        Refresh Status
                    </button>
                </div>

                <div className="info-section">
                    <h2>Next Steps</h2>
                    <ul>
                        <li>âœ… Phase 1: Project Setup (Current)</li>
                        <li>ðŸ”„ Phase 2: Backend Development (PDF Processing & Neo4j)</li>
                        <li>ðŸ”„ Phase 3: Frontend Development (Upload & Query UI)</li>
                        <li>ðŸ”„ Phase 4: Integration & Data Flow</li>
                        <li>ðŸ”„ Phase 5: Testing & Deployment</li>
                    </ul>
                </div>
            </header>
        </div>
    );
}

export default App;
